 values including integrity, trust and passion and ever-evolving innovation are some of the key reasons why some of the world\'s largest live event brands choose to work with us.'),(5845,226,'_content_group_bottom_content_sections_0_content','field_62d9cf4c56c9a'),(5846,226,'content_group_bottom_content_sections_1_classes','text-white masterful-direction'),(5847,226,'_content_group_bottom_content_sections_1_classes','field_62d9cf4c56c85'),(5848,226,'content_group_bottom_content_sections_1_style','background-color: var(--accent-primary);background-size: contain;background-position:right;border-top:15px solid var(--accent-primary);border-bottom:15px solid var(--accent-primary);'),(5849,226,'_content_group_bottom_content_sections_1_style','field_62d9cf4c56c89'),(5850,226,'content_group_bottom_content_sections_1_background_image','180'),(5851,226,'_content_group_bottom_content_sections_1_background_image','field_62d9cf4c56c8c'),(5852,226,'content_group_bottom_content_sections_1_image_data_aos',''),(5853,226,'_content_group_bottom_content_sections_1_image_data_aos','field_62d9cf4c56c8e'),(5854,226,'content_group_bottom_content_sections_1_image',''),(5855,226,'_content_group_bottom_content_sections_1_image','field_62d9cf4c56c92'),(5856,226,'content_group_bottom_content_sections_1_content_data_aos',''),(5857,226,'_content_group_bottom_content_sections_1_content_data_aos','field_62d9cf4c56c96'),(5858,226,'content_group_bottom_content_sections_1_content','<h6>Masterful Direction</h6>\r\n<div class=\"divider\"></div>\r\n<h2>CONFIRMING OUR COMMITMENT</h2>\r\nOur people. Our standards, Our processes. These are the difference makers in ensuring that the work we do for you will be done at the highest level of excellence and quality.\r\n\r\nWe view ourselves as keepers of your trust and stewards of our shared resources. To come together and get the job done right the first time.'),(5859,226,'_content_group_bottom_content_sections_1_content','field_62d9cf4c56c9a'),(5860,226,'partn