 based in Dallas with local, regional, and national experience. We have a solid track record of</span> <span style=\"font-weight: 400;\">developing impactful and engaging campaigns that increase brand recognition, positively impact consumer choice, and drive</span> <span style=\"font-weight: 400;\">revenue growth.</span>'),(5978,233,'_sections_0_content','field_60f9c840a20bd'),(5979,233,'sections_1_data_aos','fade-up'),(5980,233,'_sections_1_data_aos','field_61003aa8b3a47'),(5981,233,'sections_1_image','309'),(5982,233,'_sections_1_image','field_60f9c901b98fb'),(5983,233,'sections_1_label','Bio'),(5984,233,'_sections_1_label','field_60f9c839a20bc'),(5985,233,'sections_1_content','<span style=\"font-weight: 400;\">Paul has over 20 years of live entertainment and sports marketing experience. He has worked in senior level marketing roles for the NBA‚Äôs Dallas Mavericks and Lone Star Park at Grand Prairie. His responsibilities included oversight of all marketing &amp; advertising initiatives, handling corporate partnership and ticketing programs, game/race day presentation, community &amp; public relations, broadcast and digital initiatives. During his tenure with the Mavs, the team made two NBA Finals appearances and won the 2011 NBA Championship. Prior to the Dallas Mavericks and Thoroughbred Horse Racing experience he began his career in live entertainment as a Regional Marketing and Sales Director for Feld Entertainment, widely known as the foremost live, family entertainment company in the world, touting Ringling Bros. and Barnum &amp; Bailey Circus and Disney On Ice. There, he was responsible for overseeing all marketing &amp; sales in over twenty markets throughout Texas and Oklahoma. Paul has also taught an Advanced Sports Communication course at Southern Methodist University. He received his bachelor‚Äôs degree in finance from Florida State University and MBA in marketing from The University of Texas at Dallas. Paul lives in Plano, Texas with his wife and two 