 Retail, and F&amp;B</li>\r\n 	<li>Contract Negotiation</li>\r\n 	<li><span style=\"font-weight: 400;\">Group Sales</span></li>\r\n</ul>\r\n<!-- /wp:list-item -->\r\n\r\n<!-- /wp:list -->'),(6139,80,'_description','field_5f7cd08853323'),(6140,80,'background_image',''),(6141,80,'_background_image','field_5f7cd09153324'),(6142,80,'content',''),(6143,80,'_content','field_5f7cd09c53325'),(6144,284,'_wp_attached_file','2023/01/Account-Event-Management.jpg'),(6145,284,'_wp_attachment_metadata','a:6:{s:5:\"width\";i:1200;s:6:\"height\";i:1700;s:4:\"file\";s:36:\"2023/01/Account-Event-Management.jpg\";s:8:\"filesize\";i:419704;s:5:\"sizes\";a:5:{s:6:\"medium\";a:5:{s:4:\"file\";s:36:\"Account-Event-Management-212x300.jpg\";s:5:\"width\";i:212;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:18152;}s:5:\"large\";a:5:{s:4:\"file\";s:37:\"Account-Event-Management-723x1024.jpg\";s:5:\"width\";i:723;s:6:\"height\";i:1024;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:139655;}s:9:\"thumbnail\";a:5:{s:4:\"file\";s:36:\"Account-Event-Management-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:8071;}s:12:\"medium_large\";a:5:{s:4:\"file\";s:37:\"Account-Event-Management-768x1088.jpg\";s:5:\"width\";i:768;s:6:\"height\";i:1088;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:152239;}s:9:\"1536x1536\";a:5:{s:4:\"file\";s:38:\"Account-Event-Management-1084x1536.jpg\";s:5:\"width\";i:1084;s:6:\"height\";i:1536;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:266810;}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(6146,284,'_wp_attachment_image_alt','Account-Event-