4,'_description','field_5f7cd08853323'),(6185,84,'background_image',''),(6186,84,'_background_image','field_5f7cd09153324'),(6187,84,'content',''),(6188,84,'_content','field_5f7cd09c53325'),(6189,86,'main_image',''),(6190,86,'_main_image','field_5f7cd3479ec82'),(6191,86,'mobile_image',''),(6192,86,'_mobile_image','field_61e5b365471f1'),(6193,86,'main_title',''),(6194,86,'_main_title','field_5f7cd08153322'),(6195,86,'description','<!-- wp:paragraph -->\r\n\r\nMonroe Consulting can create campaigns that are designed to generate buzz and excitement around your product, service, or brand. These can take many forms, such as a special event, promotional item or a marketing campaign. These tailored events and promotions can be used to attract new customers, engage with existing ones, and build loyalty. They can also be used to drive traffic to an engagement, exhibition, or other location, and to increase sales or other desired outcomes. We take pride in careful planning and execution, which can involve the use of various marketing channels and tactics, such as social media, email marketing, traditional media and public relations.\r\n<ul>\r\n 	<li>Live Events</li>\r\n 	<li>Exhibitions</li>\r\n 	<li>Concerts</li>\r\n 	<li>Trade Shows</li>\r\n 	<li>Grand Openings, Ribbon Cuttings, Premiers</li>\r\n 	<li>Artist / Talent Management</li>\r\n 	<li>Promotional Items</li>\r\n 	<li>Brand Ambassadors / Street Teams</li>\r\n 	<li>Activation / Fulfillment</li>\r\n 	<li>Product Sampling</li>\r\n 	<li>Contests and Prize Insurance</li>\r\n 	<li>Sponsorships</li>\r\n</ul>\r\n<!-- /wp:list-item -->\r\n\r\n<!-- /wp:list -->'),(6196,86,'_description','field_5f7cd08853323'),(6197,86,'background_image',''),(6198,86,'_background_image','field_5f7cd09153324'),(6199,86,'content',''),(6200,86,'_content','field_5f7cd09c53325'),(6201,82,'main_image',''),(6202,82,'_main_image','field_5f7cd3479ec82'),(6203,82,'mobile_image',''),(6204,82,'_mobile_image','field_61e5b365471f1'),(6205,82,'main_title',''),(6206,82,'_main_title','field_5f7cd08153322'),(6207,82,'description','<!-- wp:paragraph -->\r\n\r\nMedia Planning is a crucial aspect of advertising, involving the development and implementation of a comprehensive media strategy to effectively reach target audiences. Monroe Consulting offers a range of services, including media planning, media buying, barter, and posting, with an expertise in national and local TV &amp; radio broadcast, digital paid &amp; organic, out of home, print and non-traditional media.\r\n<ul>\r\n 	<li>Full-Service Media</li>\r\n 	<li>Media Strategy &amp; Planning</li>\r\n 	<li>Media Buying &amp; Posting\r\n<ul>\r\n 	<li>TV and Radio</li>\r\n 	<li>Digital (Display, Search &amp; Social)</li>\r\n 	<li>Out of Home (Billboards,Transit, Mall)</li>\r\n 	<li>Print (Local &amp; National)</li>\r\n</ul>\r\n</li>\r\n 	<li>Hispanic Marketing</li>\r\n 	<li>Non-traditional Media</li>\r\n</ul>\r\n<!-- /wp:list-item -->\r\n\r\n<!-- /wp:list -->'),(6208,82,'_description','field_5f7cd08853323'),(6209,82,'background_image',''),(6210,82,'_background_image','field_5f7cd09153324'),(6211,82,'content',''),(6212,82,'_content','field_5f7cd09c53325'),(6213,250,'_wp_trash_meta_status','publish'),(6214,250,'_wp_trash_meta_time','1673549012'),(6215,250,'_wp_desired_post_slug','projects'),(6216,292,'_edit_lock','1673549077:1'),(6217,292,'_thumbnail_id','147'),(6218,292,'_edit_last','1'),(6219,292,'custom_css',''),(6220,292,'_custom_css','field_605cafca65108'),(6221,292,'_yoast_wpseo_estimated-reading-time-minutes','0'),(6222,292,'_yoast_wpseo_wordproof_timestamp',''),(6223,1,'_wp_trash_meta_status','publish'),(6224,1,'_wp_trash_meta_time','1673549429'),(6225,1,'_wp_desired_post_slug','hello-world'),(6226,1,'_wp_trash_meta_comments_status','a:1:{i:1;s:1:\"1\";}'),(6227,293,'_edit_last','1'),(6228,293,'_edit_lock','1673552079:1'),(6229,132,'column_left','<h2><img class=\"alignnone size-medium wp-image-146\" src=\"https://wordpress-704079-2821771.cloudwaysapps.com/wp-content/u