_content','<h6>Masterful Direction</h6>\r\n<div class=\"divider\"></div>\r\n<h2>CONFIRMING OUR COMMITMENT</h2>\r\nOur people. Our standards, Our processes. These are the difference makers in ensuring that the work we do for you will be done at the highest level of excellence and quality.\r\n\r\nWe view ourselves as keepers of your trust and stewards of our shared resources. To come together and get the job done right the first time.'),(6331,299,'_content_group_bottom_content_sections_1_content','field_62d9cf4c56c9a'),(6332,299,'partners_group_content','<h2>PARTNERS</h2>'),(6333,299,'_partners_group_content','field_62daffa3ccee3'),(6334,299,'partners_group_gallery',''),(6335,299,'_partners_group_gallery','field_62db0267ccee4'),(6336,299,'partners_group',''),(6337,299,'_partners_group','field_62daff98ccee2'),(6338,299,'content_group_content_sections_0_option','Content + Image'),(6339,299,'_content_group_content_sections_0_option','field_62db083b30f19'),(6340,299,'content_group_content_sections_1_option','Big Image with Subtitle'),(6341,299,'_content_group_content_sections_1_option','field_62db083b30f19'),(6342,299,'content_group_content_sections_1_big_image','163'),(6343,299,'_content_group_content_sections_1_big_image','field_62db08ea30f1a'),(6344,299,'relationship_content_content','<h2 class=\"blair-light\">INSIGHTS</h2>'),(6345,299,'_relationship_content_content','field_62fd0b911b0d1'),(6346,299,'relationship_content_relationship','a:3:{i:0;s:3:\"196\";i:1;s:3:\"199\";i:2;s:3:\"202\";}'),(6347,299,'_relationship_content_relationship','field_62fd0b981b0d2'),(6348,299,'relationship_content',''),(6349,299,'_relationship_content','field_62fd0b7e1b0d0'),(6350,299,'testimonials_content_title','TESTIMONIALS'),(6351,299,'_testimonials_content_title','field_61605c5dc91b2'),(6352,299,'testimonials_content_content',''),(6353,299,'_testimonials_content_content','field_61605bf9122d9'),(6354,299,'testimonials_content',''),(6355,299,'_testimonials_content','field_61605bec122d8'),(6356,299,'testimonials_0_content','Paul and I worked alongside each other at the Dallas Mavericks overseeing partnership marketing platforms for brands seeking to align themselves with our organization. Through collaboration with our clients, we introduced first-of-its-kind organizational promotional campaigns that were recognized by the NBA as best practices. As Director of Marketing, Paul collaborated with the ticket sales department to ensure the NBA\'s longest consecutive games sellout streak.\r\n\r\nPaul\'s ability to multi-task and collaborate with internal and external stakeholders positioned the Dallas Mavericks as thought leaders and innovators in the NBA. Paul augmented these skills in subsequent roles.. He offers these same core competencies for clients seeking someone dedicated, intelligent and energetic.'),(6357,299,'_testimonials_0_content','field_5fce74d0375fd'),(6358,299,'testimonials_0_name','Jay Ory'),(6359,299,'_testimonials_0_name','field_5fce74e6375fe'),(6360,299,'testimonials_0_job_title','Advertising | Partnership Sales and Marketing | Experiential Marketing | Naming Rights | Hospitality Sales'),(6361,299,'_testimonials_0_job_title','field_5fce74ed375ff'),(6362,299,'testimonials_1_content','Just had the pleasure to work on our first project together and I can guarantee it won‚Äôt be the last. Paul is perfectly organized, takes complete reasonability and the lead on all his projects. His approach brought laughter and a friendly manner to an intense list of assets. Overall, he made us better producers with his positive influence and encouragement. A solution driven guy and wasn‚Äôt afraid of going beyond his job to make ours easier. Not only do I recommend Paul and Monroe Consulting, I look forward to the next project he brings our way and the possibilities of being able to recommend any of our clients looking for his successful services!'),(6363,299,'_testimonials_1_content','field_5fce74d0375fd'),(6364,299,'testimonials_1_name','Ron Mewis'),(6365,299,'_testimonials_1_name','field_5fce74e6375fe'),(6366,299,'testimonials_1_job_title','Radio, TV, Print, Electronic Media production for Live Tours, Record Labels, Venues & Agencies'),(6367,299,'_testimonials_1_job_title','field_5fce74ed375ff'),(6368,299,'testimonials_2_content','Paul‚Äôs knowledge of the DFW market is second to none. He is an outstanding leader, very charismatic and all of his decisions were made with the company‚Äôs success &amp; growth at the forefront. If you can get your hands on him‚Ä¶don‚Äôt think twice.'),(6369,299,'_testimonials_2_content','field_5fce74d0375fd'),(6370,299,'testimonials_2_name','Brandy Pierce'),(6371,299,'_testimonials_2_name','field_5fce74e6375fe'),(6372,299,'testimonials_2_job_title','Senior Marketing & Events Manager | Entertainment Director | Project Manager | Award-Winning Leadership | #ONO'),(6373,299,'_testimonials_2_job_title','field_5fce74ed375ff'),(6374,299,'testimonials','3'),(6375,299,'_testimonials','field_5fce74c6375fc'),(6376,299,'content_group_bottom_content_sections_0_gallery_top',''),(6377,299,'_content_group_bottom_content_sections_0_gallery_top','field_63bf3f80fc37f'),(6378,299,'content_group_bottom_content_sections_0_gallery_bottom','a:8:{i:0;s:3:\"263\";i:1;s:3:\"271\";i:2;s:3:\"265\";i:3;s:3:\"264\";i:4;s:3:\"262\";i:5;s:3:\"267\";i:6;s:3:\"268\";i:7;s:3:\"270\";}'),(6379,299,'_content_group_bottom_content_sections_0_gallery_bottom','field_63bf3f91fc380'),(6380,299,'content_group_bottom_content_sections_1_gallery_top',''),(6381,299,'_content_group_bottom_content_sections_1_gallery_top','field_63bf3f80fc37f'),(6382,299,'content_group_bottom_content_sections_1_gallery_bottom',''),(6383,299,'_content_group_bottom_content_sections_1_gallery_bottom','field_63bf3f91fc380'),(6384,300,'custom_css','.masterful-direction .overlay-bg {\r\nbackground: rgb(24,34,54);\r\nbackground: linear-gradient(90deg, rgba(24,34,54,1) 0%, rgba(24,34,54,1) 50%, rgba(255,255,255,0) 100%);\r\n}\r\n\r\n@media only screen and (