t_title','field_61605c5dc91b2'),(6492,300,'testimonials_content_content',''),(6493,300,'_testimonials_content_content','field_61605bf9122d9'),(6494,300,'testimonials_content',''),(6495,300,'_testimonials_content','field_61605bec122d8'),(6496,300,'testimonials_0_content','Paul and I worked alongside each other at the Dallas Mavericks overseeing partnership marketing platforms for brands seeking to align themselves with our organization. Through collaboration with our clients, we introduced first-of-its-kind organizational promotional campaigns that were recognized by the NBA as best practices. As Director of Marketing, Paul collaborated with the ticket sales department to ensure the NBA\'s longest consecutive games sellout streak.\r\n\r\nPaul\'s ability to multi-task and collaborate with internal and external stakeholders positioned the Dallas Mavericks as thought leaders and innovators in the NBA. Paul augmented these skills in subsequent roles.. He offers these same core competencies for clients seeking someone dedicated, intelligent and energetic.'),(6497,300,'_testimonials_0_content','field_5fce74d0375fd'),(6498,300,'testimonials_0_name','Jay Ory'),(6499,300,'_testimonials_0_name','field_5fce74e6375fe'),(6500,300,'testimonials_0_job_title','Advertising | Partnership Sales and Marketing | Experiential Marketing | Naming Rights | Hospitality Sales'),(6501,300,'_testimonials_0_job_title','field_5fce74ed375ff'),(6502,300,'testimonials_1_content','Just had the pleasure to work on our first project together and I can guarantee it won‚Äôt be the last. Paul is perfectly organized, takes complete reasonability and the lead on all his projects. His approach brought laughter and a friendly manner to an intense list of assets. Overall, he made us better producers with his positive influence and encouragement. A solution driven guy and wasn‚Äôt afraid of going beyond his job to make ours easier. Not only do I recommend Paul and Monroe Consulting, I look forward to the next project he brings our way and the possibilities of being able to recommend any of our clients looking for his successful services!'),(6503,300,'_testimonials_1_content','field_5fce74d0375fd'),(6504,300,'testimonials_1_name','Ron Mewis'),(6505,300,'_testimonials_1_name','field_5fce74e6375fe'),(6506,300,'testimonials_1_job_title','Radio, TV, Print, Electronic Media production for Live Tours, Record Labels, Venues & Agencies'),(6507,300,'_testimonials_1_job_title','field_5fce74ed375ff'),(6508,300,'testimonials_2_content','Paul‚Äôs knowledge of the DFW market is second to none. He is an outstanding leader, very charismatic and all of his decisions were made with the company‚Äôs success &amp; growth at the forefront. If you can get your hands on him‚Ä¶don‚Äôt think twice.'),(6509,300,'_testimonials_2_content','field_5fce74d0375fd'),(6510,300,'testimonials_2_name','Brandy Pierce'),(6511,300,'_testimonials_2_name','field_5fce74e6375fe'),(6512,300,'testimonials_2_job_title','Senior Marketing & Events Manager | Entertainment Director | Project Manager | Award-Winning Leadership | #ONO'),(6513,300,'_testimonials_2_job_title','field_5fce74ed375ff'),(6514,300,'testimonials','3'),(6515,300,'_testimonials','field_5fce74c6375fc'),(6516,300,'content_group_bottom_content_sections_0_gallery_top',''),(6517,300,'_content_group_bottom_content_sections_0_gallery_top','field_63bf3f80fc37f'),(6518,300,'content_group_bottom_content_sections_0_gallery_bottom','a:8:{i:0;s:3:\"263\";i:1;s:3:\"271\";i:2;s:3:\"265\";i:3;s:3:\"264\";i:4;s:3:\"262\";i:5;s:3:\"267\";i:6;s:3:\"268\";i:7;s:3:\"270\";}'),(6519,300,'_content_group_bottom_content_sections_0_gallery_bottom','field_63bf3f91fc380'),(6520,300,'content_group_bottom_content_sections_1_gallery_top',''),(6521,300,'_content_group_bottom_content_sections_1_gallery_top','field_63bf3f80fc37f'),(6522,300,'content_group_bottom_content_sections_1_gallery_bottom',''),(6523,300,'_content_group_bottom_content_sections_1_gallery_bottom','field_63bf3f91fc380