),(6612,304,'content_group_bottom_content_sections_0_content','<h6>Integrity</h6>\r\n<div class=\"divider\"></div>\r\n<h2>WHY TRUST US?</h2>\r\nUnlike many event planning companies that tend to be impersonal, and unimaginative, Monroe Consulting provides a creative problem-solving approach to every client\'s needs.\r\n\r\nFounded on core business values including integrity, trust and passion and ever-evolving innovation are some of the key reasons why some of the world\'s largest live event brands choose to work with us.'),(6613,304,'_content_group_bottom_content_sections_0_content','field_62d9cf4c56c9a'),(6614,304,'content_group_bottom_content_sections_1_classes','text-white masterful-direction'),(6615,304,'_content_group_bottom_content_sections_1_classes','field_62d9cf4c56c85'),(6616,304,'content_group_bottom_content_sections_1_style','background-color: var(--accent-primary);background-size: contain;background-position:right;border-top:15px solid var(--accent-primary);border-bottom:15px solid var(--accent-primary);'),(6617,304,'_content_group_bottom_content_sections_1_style','field_62d9cf4c56c89'),(6618,304,'content_group_bottom_content_sections_1_background_image','180'),(6619,304,'_content_group_bottom_content_sections_1_background_image','field_62d9cf4c56c8c'),(6620,304,'content_group_bottom_content_sections_1_image_data_aos',''),(6621,304,'_content_group_bottom_content_sections_1_image_data_aos','field_62d9cf4c56c8e'),(6622,304,'content_group_bottom_content_sections_1_image',''),(6623,304,'_content_group_bottom_content_sections_1_image','field_62d9cf4c56c92'),(6624,304,'content_group_bottom_content_sections_1_content_data_aos',''),(6625,304,'_content_group_bottom_content_sections_1_content_data_aos','field_62d9cf4c56c96'),(6626,304,'content_group_bottom_content_sections_1_content','<h6>Masterful Direction</h6>\r\n<div class=\"divider\"></div>\r\n<h2>CONFIRMING OUR COMMITMENT</h2>\r\nOur people. Our standards, Our processes. These are the difference makers in ensuring that the work we do for you will be done at the highest level of excellence and quality.\r\n\r\nWe view ourselves as keepers of your trust and stewards of our shared resources. To come together and get the job done right the first time.'),(6627,304,'_content_group_bottom_content_sections_1_content','field_62d9cf4c56c9a'),(6628,304,'partners_group_content','<h2>PARTNERS</h2>'),(6629,304,'_partners_group_content','field_62daffa3ccee3'),(6630,304,'partners_group_gallery',''),(6631,304,'_partners_group_gallery','field_62db0267ccee4'),(6632,304,'partners_group',''),(6633,304,'_partners_group','field_62daff98ccee2'),(6634,304,'content_group_content_sections_0_option','Content + Image'),(6635,304,'_content_group_content_sections_0_option','field_62db083b30f19'),(6636,304,'content_group_content_sections_1_option','Big Image with Subtitle'),(6637,304,'_content_group_content_sections_1_option','field_62db083b30f19'),(6638,304,'content_group_content_sections_1_big_image','163'),(6639,304,'_content_group_content_sections_1_big_image','field_62db08ea30f1a'),(6640,304,'relationship_content_content','<h2 class=\"blair-light\">INSIGHTS</h2>'),(6641,304,'_relationship_content_content','field_62fd0b911b0d1'),(6642,304,'relationship_content_relationship','a:3:{i:0;s:3:\"196\";i:1;s:3:\"199\";i:2;s:3:\"202\";}'),(6643,304,'_relationship_content_relationship','field_62fd0b981b0d2'),(6644,304,'relationship_content',''),(6645,304,'_relationship_content','field_62fd0b7e1b0d0'),(6646,304,'testimonials_content_title','TESTIMONIALS'),(6647,304,'_testimonials_content_title','field_61605c5dc91b2'),(6648,304,'testimonials_content_content',''),(6649,304,'_testimonials_content_content','field_61605bf9122d9'),(6650,304,'testimonials_content',''),(6651,304,'_testimonials_content','field_61605bec122d8'),(6652,304,'testimonials_0_content','Paul and I worked alongside each other at the Dallas Mavericks overseeing partnership marketing platforms for brands seeking to align themselves with our organization. Through collaboration with our clients, we introduced first-of-its-kind organizational promotional campaigns that were recognized by the NBA as best practices. As Director of Marketing, Paul collaborated with the ticket sales department to ensure the NBA\'s longest consecutive games sellout streak.\r\n\r\nPaul\'s ability to multi-task and collaborate with internal and external stakeholders positioned the Dallas Mavericks as thought leaders and innovators in the NBA. Paul augmented these skills in subsequent roles.. He offers these same core competencies for clients seeking someone dedicated, intelligent and energetic.'),(6653,304,'_testimonials_0_content','field_5fce74d0375fd'),(6654,304,'testimonials_0_name','Jay Ory'),(6655,304,'_testimonials_0_name','field_5fce74e6375fe'),(6656,304,'testimonials_0_job_title','Advertising | Partnership Sales and Marketing | Experiential Marketing | Naming Rights | Hospitality Sales'),(6657,304,'_testimonials_0_job_title','field_5fce74ed375ff'),(6658,304,'testimonials_1_content','Just had the pleasure to work on our first project together and I can guarantee it won‚Äôt be the last. Paul is perfectly organized, takes complete reasonability and the lead on all his projects. His approach brought laughter and a friendly manner to an intense list of assets. Overall, he made us better producers with his positive influence and encouragement. A solution driven guy and wasn‚Äôt afraid of going beyond his job to make ours easier. Not only do I recommend Paul and Monroe Consulting, I look forward to the next project he brings our way and the possibilities of being able to recommend any of our clients looking for his successful services!'),(6659,304,'_testimonials_1_content','field_5fce74d0375fd'),(6660,304,'testimonials_1_name','Ron Mewis'),(6661,304,'_testimonials_1_name','field_5fce74e6375fe'),(6662,304,'testimonials_1_job_title','Radio, TV, Print, Electronic Media production for Live Tours, Record Labels, Venues & Agencies'),(6663,304,'_testimonials_1_job_title','field_5fce74ed375ff'),(6664,304,'testimonials_2_content','Paul‚Äôs knowledge of the DFW market is second to none. He is an outstanding leader, very charismatic and all of his decisions were made with the company‚Äôs success &amp; growth at the forefront. If you can get your hands on him‚Ä¶don‚Äôt think twice.'),(6665,304,'_testimonials_2_content','field_5fce74d0375fd'),(6666,304,'testimonials_2_name','Brandy Pierce'),(6667,304,'_testimonials_2_name','field_5fce74e6375fe'),(6668,304,'testimonials_2_job_title','Senior Marketing & Events Manager | Entertainment Director | Project Manager | Award-Winning Leadership | #ONO'),(6669,304,'_testimonials_2_job_title','field_5fce74ed375ff'),(6670,304,'testimonials','3'),(6671,304,'_testimonials','field_5fce74c6375fc'),(6672,304,'content_group_bottom_content_sections_0_gallery_top',''),(6673,304,'_content_group_bottom_content_sections_0_gallery_top','field_63bf3f80fc37f'),(6674,304,'content_group_bottom_content_sections_0_gallery_bottom','a:8:{i:0;s:3:\"263\";i:1;s:3:\"303\";i:2;s:3:\"265\";i:3;s:3:\"264\";i:4;s:3:\"262\";i:5;s:3:\"267\";i:6;s:3:\"268\";i:7;s:3:\"270\";}'),(6675,304,'_content_group_bottom_content_sections_0_gallery_bottom','field_63bf3f91fc380'),(6676,304,'content_group_bottom_content_sections_1_gallery_top',''),(6677,304,'_content_group_bottom_content_sections_1_gallery_top','field_63bf3f80fc37f'),(6678,304,'content_group_bottom_content_sections_1_gallery_bottom',''),(6679,304,'_content_group_bottom_content_sections_1_gallery_bottom','field_63bf3f91fc380'),(6680,305,'_wp_attached_file','2023/01/Media-Planning-Buying-1.jpg'),(6681,305,'_wp_attachment_metadata','a:6:{s:5:\"width\";i:1200;s:6:\"height\";i:1700;s:4:\"file\";s:35:\"2023/01/Media-Planning-Buying-1.jpg\";s:8:\"filesize\";i:293036;s:5:\"sizes\";a:5:{s:6:\"medium\";a:5:{s:4:\"file\";s:35:\"Media-Planning-Buying-1-212x300.jpg\";s:5:\"width\";i:212;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"files