8,'column_right','[gravityform id=\"1\" title=\"false\" description=\"false\" ajax=\"true\"]'),(6708,308,'_column_right','field_63c05d300ecce'),(6709,309,'_wp_attached_file','2023/01/Paul-image.jpg'),(6710,309,'_wp_attachment_metadata','a:6:{s:5:\"width\";i:1075;s:6:\"height\";i:1080;s:4:\"file\";s:22:\"2023/01/Paul-image.jpg\";s:8:\"filesize\";i:48356;s:5:\"sizes\";a:4:{s:6:\"medium\";a:5:{s:4:\"file\";s:22:\"Paul-image-300x300.jpg\";s:5:\"width\";i:300;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:9039;}s:5:\"large\";a:5:{s:4:\"file\";s:24:\"Paul-image-1019x1024.jpg\";s:5:\"width\";i:1019;s:6:\"height\";i:1024;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:55987;}s:9:\"thumbnail\";a:5:{s:4:\"file\";s:22:\"Paul-image-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:3337;}s:12:\"medium_large\";a:5:{s:4:\"file\";s:22:\"Paul-image-768x772.jpg\";s:5:\"width\";i:768;s:6:\"height\";i:772;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:34936;}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(6711,310,'custom_css',''),(6712,310,'_custom_css','field_605cafca65108'),(6713,310,'sections_0_data_aos','fade-up'),(6714,310,'_sections_0_data_aos','field_61003aa8b3a47'),(6715,310,'sections_0_image','309'),(6716,310,'_sections_0_image','field_60f9c901b98fb'),(6717,310,'sections_0_label','About Monroe'),(6718,310,'_sections_0_label','field_60f9c839a20bc'),(6719,310,'sections_0_content','<span style=\"font-weight: 400;\">Monroe Consulting is a full service, boutique marketing agency providing a variety of services including account management, event management, traditional and digital media planning &amp; buying, creative services, public relations, sponsorships, and more. We bring together a team of professionals that have extensive experience in developing, implementing, and executing effective, integrated marketing campaigns for numerous live family events. The team includes highly seasoned event marketing &amp; sales experts based in Dallas with local, regional, and national experience. We have a solid track record of</span> <span style=\"font-weight: 400;\">developing impactful and engaging campaigns that increase brand recognition, positively impact consumer choice, and drive</span> <span style=\"font-weight: 400;\">revenue growth.</span>'),(6720,310,'_sections_0_content','field_60f9c840a20bd'),(6721,310,'sections_1_data_aos','fade-up'),(6722,310,'_sections_1_data_aos','field_61003aa8b3a47'),(6723,310,'sections_1_image','309'),(6724,310,'_sections_1_image','field_60f9c901b98fb'),(6725,310,'sections_1_label','About Paul'),(6726,310,'_sections_1_label','field_60f9c839a20bc'),(6727,310,'sections_1_content','<span style=\"font-weight: 400;\">Paul has over 20 years of live entertainment and sports marketing experience. He has worked in senior level marketing roles for the NBA‚Äôs Dallas Mavericks and Lone Star Park at Grand Prairie. His responsibilities included oversight of all marketing &amp; advertising initiatives, handling corporate partnership and ticketing programs, game/race day presentation, community &amp; public relations, broadcast and digital initiatives. During his tenure with the Mavs, the team made two NBA Finals appearances and won the 2011 NBA Championship. Prior to the Dallas Mavericks and Thoroughbred Horse Racing experience he began his career in live entertainment as a Regional Marketing and Sales Director for Feld Entertainment, widely known as the foremost live, family entertainment company in the world, touting Ringling Bros. and Barnum &amp; Bailey Circus and Disney On Ice. There, he was responsible for overseeing all marketing &amp; sales in over twenty markets throughout Texas and Oklahoma. Paul has also taught an Advanced Sports Communication course at Southern Methodist University. He received his bachelor‚Äôs degree in finance from Florida State University and MBA in marketing from The University of Texas at Dallas. Paul lives in Plano, Texas with his wife and two boys.</span>'),(6728,310,'_sections_1_content','field_60f9c840a20bd'),(6729,310,'sections','2'),(6730,310,'_sections','field_60f9c7c2a20bb'),(6731,311,'custom_css',''),(6732,311,'_custom_css','field_605cafca65108'),(6733,311,'sections_0_data_aos','fade-up'),(6734,311,'_sections_0_data_aos','field_61003aa8b3a47'),(6735,311,'sections_0_image','309'),(6736,311,'_sections_0_image','field_60f9c901b98fb'),(6737,311,'sections_0_label','Company'),(6738,311,'_sections_0_label','field_60f9c839a20bc'),(6739,311,'sections_0_content','<span style=\"font-weight: 400;\">Monroe Consulting is a full service, boutique marketing agency providing a variety of services including account management, event management, traditional and digital media planning &amp; buying, creative services, public relations, sponsorships, and more. We bring together a team of professionals that have extensive experience in developing, implementing, and executing effective, integrated marketing campaigns for numerous live family events. The team includes highly seasoned event marketing &amp; sales experts based in Dallas with local, regional, and national experience. We have a solid track record of</span> <span style=\"font-weight: 400;\">developing impactful and engaging campaigns that increase brand recognition, positively impact consumer choice, and drive</span> <span style=\"font-weight: 400;\">revenue growth.</span>'),(6740,311,'_sections_0_content','field_60f9c840a20bd'),(6741,311,'sections_1_data_aos','fade-up'),(6742,311,'_sections_1_data_aos','field_61003aa8b3a47'),(6743,311,'sections_1_image','309'),(6744,311,'_sections_1_image','field_60f9c901b98fb'),(6745,311,'sections_1_label','Bio'),(6746,311,'_sections_1_label','field_60f9c839a20bc'),(6747,311,'sections_1_content','<span style=\"font-weight: 400;\">Paul has over 20 years of live entertainment and sports marketing experience. He has worked in senior level marketing roles for the NBA‚Äôs Dallas Mavericks and Lone Star Park at Grand Prairie. His responsibilities included oversight of all marketing &amp; advertising initiatives, handling corporate partnership and ticketing programs, game/race day presentation, community &amp; public relations, broadcast and digital initiatives. During his tenure with the Mavs, the team made two NBA Finals appearances and won the 2011 NBA Championship. Prior to the Dallas Mavericks and Thoroughbred Horse Racing experience he began his career in live entertainment as a Regional Marketing and Sales Director for Feld Entertainment, widely known as the foremost live, family entertainment company in the world, touting Ringling Bros. and Barnum &amp; Bailey Circus and Disney On Ice. There, he was responsible for overseeing all marketing &amp; sales in over twenty markets throughout Texas and Oklahoma. Paul has also taught an Advanced Sports Communication course at Southern Methodist University. He received his bachelor‚Äôs degree in finance from Florida State University and MBA in marketing from The University of Texas at Dallas. Paul lives in Plano, Texas with his wife and two boys.</span>'),(6748,311,'_sections_1_content','field_60f9c840a20bd'),(6749,311,'sections','2'),(6750,311,'_sections','field_60f9c7c2a20bb'),(6751,312,'_edit_lock','1674580436:1'),(6752,312,'_edit_last','1'),(6753,312,'custom_css',''),(6754,312,'_custom_css','field_605cafca65108'),(6755,312,'_yoast_wpseo_estimated-reading-time-minutes','0'),(6756,312,'_yoast_wpseo_wordproof_timestamp',''),(6757,312,'_wp_page_template','templates/content-page.php'),(6758,312,'_thumbnail_id','317'),(6759,312,'main_image',''),(6760,312,'_main_image','field_5f7