','field_62d9cf4c56c96'),(7293,330,'content_group_bottom_content_sections_0_content','<h6>Integrity</h6>\r\n<div class=\"divider\"></div>\r\n<h2>WHY TRUST US?</h2>\r\nUnlike many event planning companies that tend to be impersonal, and unimaginative, Monroe Consulting provides a creative problem-solving approach to every client\'s needs.\r\n\r\nFounded on core business values including integrity, trust and passion and ever-evolving innovation are some of the key reasons why some of the world\'s largest live event brands choose to work with us.'),(7294,330,'_content_group_bottom_content_sections_0_content','field_62d9cf4c56c9a'),(7295,330,'content_group_bottom_content_sections_1_classes','text-white masterful-direction'),(7296,330,'_content_group_bottom_content_sections_1_classes','field_62d9cf4c56c85'),(7297,330,'content_group_bottom_content_sections_1_style','background-color: var(--accent-primary);background-size: contain;background-position:right;border-top:15px solid var(--accent-primary);border-bottom:15px solid var(--accent-primary);'),(7298,330,'_content_group_bottom_content_sections_1_style','field_62d9cf4c56c89'),(7299,330,'content_group_bottom_content_sections_1_background_image','180'),(7300,330,'_content_group_bottom_content_sections_1_background_image','field_62d9cf4c56c8c'),(7301,330,'content_group_bottom_content_sections_1_image_data_aos',''),(7302,330,'_content_group_bottom_content_sections_1_image_data_aos','field_62d9cf4c56c8e'),(7303,330,'content_group_bottom_content_sections_1_image',''),(7304,330,'_content_group_bottom_content_sections_1_image','field_62d9cf4c56c92'),(7305,330,'content_group_bottom_content_sections_1_content_data_aos',''),(7306,330,'_content_group_bottom_content_sections_1_content_data_aos','field_62d9cf4c56c96'),(7307,330,'content_group_bottom_content_sections_1_content','<h6>Masterful Direction</h6>\r\n<div class=\"divider\"></div>\r\n<h2>CONFIRMING OUR COMMITMENT</h2>\r\nOur people. Our standards, Our processes. These are the difference makers in ensuring that the work we do for you will be done at the highest level of excellence and quality.\r\n\r\nWe view ourselves as keepers of your trust and stewards of our shared resources. To come together and get the job done right the first time.'),(7308,330,'_content_group_bottom_content_sections_1_content','field_62d9cf4c56c9a'),(7309,330,'partners_group_content','<h2>PARTNERS</h2>'),(7310,330,'_partners_group_content','field_62daffa3ccee3'),(7311,330,'partners_group_gallery',''),(7312,330,'_partners_group_gallery','field_62db0267ccee4'),(7313,330,'partners_group',''),(7314,330,'_partners_group','field_62daff98ccee2'),(7315,330,'content_group_content_sections_0_option','Content + Image'),(7316,330,'_content_group_content_sections_0_option','field_62db083b30f19'),(7317,330,'content_group_content_sections_1_option','Big Image with Subtitle'),(7318,330,'_content_group_content_sections_1_option','field_62db083b30f19'),(7319,330,'content_group_content_sections_1_big_image','163'),(7320,330,'_content_group_content_sections_1_big_image','field_62db08ea30f1a'),(7321,330,'relationship_content_content','<h2 class=\"blair-light\">INSIGHTS</h2>'),(7322,330,'_relationship_content_content','field_62fd0b911b0d1'),(7323,330,'relationship_content_relationship','a:3:{i:0;s:3:\"196\";i:1;s:3:\"199\";i:2;s:3:\"202\";}'),(7324,330,'_relationship_content_relationship','field_62fd0b981b0d2'),(7325,330,'relationship_content',''),(7326,330,'_relationship_content','field_62fd0b7e1b0d0'),(7327,330,'testimonials_content_title','TESTIMONIALS'),(7328,330,'_testimonials_content_title','field_61605c5dc91b2'),(7329,330,'testimonials_content_content',''),(7330,330,'_testimonials_content_content','field_61605bf9122d9'),(7331,330,'testimonials_content',''),(7332,330,'_testimonials_content','field_61605bec122d8'),(7333,330,'testimonials_0_content','Paul and I worked alongside each other at the Dallas Mavericks overseeing partnership marketing platforms for brands seeking to align themselves with our organization. Through collaboration with our clients, we introduced first-of-its-kind organizational promotional campaigns that were recognized by the NBA as best practices. As Director of Marketing, Paul collaborated with the ticket sales department to ensure the NBA\'s longest consecutive games sellout streak.\r\n\r\nPaul\'s ability to multi-task and collaborate with internal and external stakeholders positioned the Dallas Mavericks as thought leaders and innovators in the NBA. Paul augmented these skills in subsequent roles.. He offers these same core competencies for clients seeking someone dedicated, intelligent and energetic.'),(7334,330,'_testimonials_0_content','field_5fce74d0375fd'),(7335,330,'testimonials_0_name','Jay Ory'),(7336,330,'_testimonials_0_name','field_5fce74e6375fe'),(7337,330,'testimonials_0_job_title','Advertising | Partnership Sales and Marketing | Experiential Marketing | Naming Rights | Hospitality Sales'),(7338,330,'_testimonials_0_job_title','field_5fce74ed375ff'),(7339,330,'testimonials_1_content','Just had the pleasure to work on our first project together and I can guarantee it won‚Äôt be the last. Paul is perfectly organized, takes complete reasonability and the lead on all his projects. His approach brought laughter and a friendly manner to an intense list of assets. Overall, he made us better producers with his positive influence and encouragement. A solution driven guy and wasn‚Äôt afraid of going beyond his job to make ours easier. Not only do I recommend Paul and Monroe Consulting, I look forward to the next project he brings our way and the possibilities of being able to recommend any of our clients looking for his successful services!'),(7340,330,'_testimonials_1_content','field_5fce74d0375fd'),(7341,330,'testimonials_1_name','Ron Mewis'),(7342,330,'_testimonials_1_name','field_5fce74e6375fe'),(7343,330,'testimonials_1_job_title','Radio, TV, Print, Electronic Media production for Live Tours, Record Labels, Venues & Agencies'),(7344,330,'_testimonials_1_job_title','field_5fce74ed375ff'),(7345,330,'testimonials_2_content','Paul‚Äôs knowledge of the DFW market is second to none. He is an outstanding leader, very charismatic and all of his decisions were made with the company‚Äôs success &amp; growth at the forefront. If you can get your hands on him‚Ä¶don‚Äôt think twice.'),(7346,330,'_testimonials_2_content','field_5fce74d0375fd'),(7347,330,'testimonials_2_name','Brandy Pierce'),(7348,330,'_testimonials_2_name','field_5fce74e6375fe'),(7349,330,'testimonials_2_job_title','Senior Marketing & Events Manager | Entertainment Director | Project Manager | Award-Winning Leadership | #ONO'),(7350,330,'_testimonials_2_job_title','field_5fce74ed375ff'),(7351,330,'testimonials','3'),(7352,330,'_testimonials','field_5fce74c6375fc'),(7353,330,'content_group_bottom_content_sections_0_gallery_top',''),(7354,330,'_content_group_bottom_content_sections_0_gallery_top','field_63bf3f80fc37f'),(7355,330,'content_group_bottom_content_sections_0_gallery_bottom','a:8:{i:0;s:3:\"263\";i:1;s:3:\"268\";i:2;s:3:\"303\";i:3;s:3:\"265\";i:4;s:3:\"264\";i:5;s:3:\"262\";i:6;s:3:\"267\";i:7;s:3:\"270\";}'),(7356,330,'_content_group_bottom_content_sections_0_gallery_bottom','field_63bf3f91fc380'),(7357,330,'content_group_bottom_content_sections_1_gallery_top',''),(7358,330,'_content_group_bottom_content_sections_1_gallery_top','field_63bf3f80fc37f'),(7359,330,'content_group_bottom_content_sections_1_gallery_bottom',''),(7360,330,'_content_group_bottom_content_sections_1_gallery_bottom','field_63bf3f91fc380'),(7365,331,'custom_css',''),(7366,331,'_custom_css','field_605cafca65108'),(7371,332,'custom_css',''),(7372,332,'_custom_css','field_605cafca65108'),(7379,334,'custom_css',''),(7380,334,'_custom_css','field_605cafca65108'),(7381,334,'main_image',''),(7382,334,'_main_image','field_5f7cd3479ec82'),(7383,334,'mobile_image',''),(7384,334,'_mobile_image','field_61e5b365471f1'),(7385,334,'main_title',''),(7386,334,'_main_title','field_5f7cd08153322'),(7387,334,'description','<!-- wp:paragraph -->\r\n\r\n<span style=\"font-weight: 400;\">No show in America is receiving more attention than 6-time Grammy Award winner Dionne Warwick‚Äôs Hits! The Musical (</span><strong><a href=\"http://www.hitsthemusical.com/\">www.hitsthemusical.com</a></strong>).\r\n\r\n<span style=\"font-weight: 400;\">The show features 100 of the most popular songs of all time like ‚ÄúSigned Sealed Delivered,‚Äù ‚ÄúI Will Always Love You,‚Äù ‚ÄúHero,‚Äù ‚ÄúAll That Jazz,‚Äù ‚ÄúSingin‚Äô in the Rain,‚Äù and ‚ÄúRolling in the Deep.‚Äù</span>\r\n\r\n<span style=\"font-weight: 400;\">Hits! The Musical is as big as any production you have seen on Broadway but is touring the country and will be coming to your city for one performance only ‚Äì <strong><a href=\"/wp-content/uploads/2023/01/Hits-The-Musical-Schedule.pdf\" target=\"_blank\" rel=\"noopener\">click here</a></strong> to see the entire schedule.¬†</span>\r\n\r\n<span style=\"font-weight: 400;\">For more information and to purchase group tickets call: 469-847-0737 or email paul@monroegrouptickets.com</span>\r\n\r\n&nbsp;\r\n\r\n<a class=\"btn btn-secondary\" href=\"/wp-content/uploads/2023/01/Group-sales-flyer_.jpg\" target=\"_blank\" rel=\"noopener\">Download Flyer</a>\r\n\r\n&nbsp;\r\n\r\n<!-- /wp:list-item -->\r\n\r\n<!-- /wp:list -->'),(7388,334,'_description','field_5f7cd08853323'),(7389,334,'background_image',''),(7390,334,'_background_image','field_5f7cd09153324'),(7391,334,'content',''),(7392,334,'_content','field_5f7cd09c53325'),(7393,335,'custom_css',''),(7394,335,'_custom_css','field_605cafca65108'),(7395,335,'main_image',''),(7396,335,'_main_image','field_5f7cd3479ec82'),(7397,335,'mobile_image',''),(7398,335,'_mobile_image','field_61e5b365471f1'),(7399,335,'main_title',''),(7400,335,'_main_title','field_5f7cd08153322'),(7401,335,'description','<!-- wp:paragraph -->\r\n\r\n<span style=\"font-weight: 400;\">No show in America is receivi